import { useState, useEffect } from "react";
import { fetchShowTagsId, fetchShowsByGalleryId } from "../../lib/api/Api";

function FetchShowTags(id) {
  const [tagIds, setTagIds] = useState(null);
  const [tags, setTags] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchShows = async (id) => {
      try {
        setError(null);
        setTagIds(await fetchShowTagsId(id));
        console.log(await fetchShowTagsId(id));
      } catch (e) {
        setError(e);
      }
    };
    fetchShows();
  }, [id]);
  console.log(tagIds);
  return tags;
}

export default FetchShowTags;
